import React from "react";
import styled from "styled-components";

// 이미지 참조
import npImg from "../assets/img/ico-sns-gray-np@2x.png";
import nbImg from "../assets/img/ico-sns-gray-nb@2x.png";
import ytImg from "../assets/img/ico-sns-yt@2x.png";
import igImg from "../assets/img/ico-sns-gray-ig@2x.png";
import fbImg from "../assets/img/ico-sns-gray-fb@2x.png";
import ttImg from "../assets/img/ico-sns-tt@2x.png";


const HeaderContainer = styled.footer`
  width: 1280px;
  height: 160px;
  border: 1px solid black;
  margin: 0 auto;

  ul {
    display: flex;
    margin: 35px 0 24px;

    li {
      margin-right: 30px;
    }
  }
`;

const header = () => {
  return (
    <HeaderContainer>
      <ul>
        <li>
          <a>이용약관</a>
        </li>
        <li>
          <a>개인정보처리방침</a>
        </li>
        <li>
          <a>고객의 소리</a>
        </li>
        <li>
          <a>병원소개</a>
        </li>
      </ul>
      <address>03722 서울특별시 서대문구 연세로 50-1</address>
      <p>COPYRIGHT(C) SEVERANCE HOSPITAL. ALL RIGHTS RESERVED.</p>
      <ul>
        <li><img src={npImg} alt="naver_post_image"/></li>
        <li><img src={nbImg} alt="naver_blog_image"/></li>
        <li><img src={ytImg} alt="youtube_image"/></li>
        <li><img src={igImg} alt="instagram_image"/></li>
        <li><img src={fbImg} alt="naver_post_image"/></li>
        <li><img src={ttImg} alt="naver_post_image"/></li>
      </ul>
    </HeaderContainer>
  );
};

export default header;
